		INPUT:
			lw  $t9, 0($k0) # t9: tecla pressionada? (0/1)
	       		beq $t9, $zero, no_keypress
       		
       			lw  $t7, 4($k0) # t7: tecla pressionada ASCII
      			beq $t7, $s5, key_A
       			beq $t7, $s6, key_D
       		
       			j no_keypress # tecla invlida
	
		 key_A: # ESQUERDA
		 	jal gerarCenario
		 	addi $s1, $s1, -12 # -24 bytes de deslocamento
		 	jal gerarPersonagem
	 	
		 	j no_keypress
		 	
		 key_D: # DIREITA
		 	jal gerarCenario
		 	addi $s1, $s1, 12 # +24 bytes de deslocamento
		 	jal gerarPersonagem
	 	
		 	j no_keypress
	
		no_keypress: j INPUT
